import React from 'react';

export default function SVGFog({ className }) {
  return (
    <svg
      className={className}
      width="600"
      height="450"
      viewBox="0 0 600 450"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      style={{ filter: 'blur(64px)' }}
    >
      {/* Larger ellipses anchored at the corner for deeper fog */}
      <ellipse cx="0" cy="450" rx="400" ry="280" fill="#fff" fillOpacity="0.22" />
      <ellipse cx="120" cy="340" rx="200" ry="140" fill="#fff" fillOpacity="0.13" />
      <ellipse cx="240" cy="250" rx="140" ry="100" fill="#fff" fillOpacity="0.09" />
    </svg>
  );
}
